    return(
        <div className='PreFlight'>
            <h1>Portfolio</h1>
            <div >
                <p className='p'>
                    To properly demonstrate what I've learned from Springboard's software engineering bootcamp, I built this website. 
                </p>
                <p>Tech Stack: React.js | CSS | Jest</p>
            </div>
        </div>
    )
}

export default Portfolio;
